Initial-populate-G2-Event() = (sequence)

tempRow: structure;
tempRows: sequence = sequence();

begin

tempRow = call assemble-g2-event-grid-row("21-Jul-2015 12:01:22", "G2", "WHAT", "I", "Testing1", "Testing1", the symbol white);
tempRows = insert-at-end(tempRows, tempRow);
tempRow = call assemble-g2-event-grid-row("21-Jul-2015 12:02:22", "G2", "WHAT", "I", "Testing2", "Testing2", the symbol white);
tempRows = insert-at-end(tempRows, tempRow);
tempRow = call assemble-g2-event-grid-row("21-Jul-2015 12:03:22", "G2", "WHAT", "I", "Testing3", "Testing3", the symbol white);
tempRows = insert-at-end(tempRows, tempRow);

return tempRows;

end

displays-query-g2-significant-event(win: class g2-window)

gridColumns: sequence;
oneRow: structure;
gridRows: sequence = sequence();
gridView: structure;
okButton: structure;
comps: sequence = sequence();
dialogWidth: integer = 500;
parent: symbol = the symbol dialogQueryG2Event;
dialogSpec: structure;
todaysDate: text;
dialogHandle: integer = 0;
{}
tempControls: sequence = sequence();
emptySequence: sequence = sequence();

begin

gridColumns = call assemble-g2-event-grid-columns();
gridRows = call initial-populate-g2-event ();

gridView = structure(
    control-type: the symbol grid-view,
    control-id: the symbol gridViewG2Event,
    height: 420, 
    width: 490,
    left: 5, 
    top: 5, 
    resizable: false, 
    horizontal-scrollbars: true, 
    vertical-scrollbars: true, 
    control-value: structure(
        columns: gridColumns, 
        rows: gridRows, 
        sorting: true,
        use-row-header: false
        ),
    response-action: the symbol ignore
    );

comps = insert-at-end(comps, gridView);

dialogSpec = structure(
    components: comps, 
    dialog-title: "G2 Event Monitor",
    dialog-is-modal: false,
    dialog-is-mdi-child: false, 
    dialog-height: 450,
    dialog-width: dialogWidth, 
    dialog-x-position: the symbol working-area-right,
    dialog-y-position: 250
    );
    
dialogHandle = call g2-ui-post-custom-dialog(dialogSpec, the symbol none, win);

post "Testing";
tempControls = call g2-ui-query-custom-dialog-values(dialogHandle, emptySequence, win);
conclude that done-parameter = 1;

post "Done";
post "[tempControls]";

end

assemble-g2-event-grid-row(txtDateTime: text, txtSource: text, txtClass: text, txtSeverity: text, txtTagName: text, txtCSVData: text, rowColor: symbol) = (structure)

tempRow: structure;

begin

tempRow = structure(
    cell-settings: sequence(
        structure(background-color: rowColor, cell-type: the symbol text-box, cell-value: structure(text-value:txtDateTime)),
        structure(background-color: rowColor, cell-type: the symbol text-box, cell-value: structure(text-value:txtSource)),
        structure(background-color: rowColor, cell-type: the symbol text-box, cell-value: structure(text-value:txtClass)),
        structure(background-color: rowColor, cell-type: the symbol text-box, cell-value: structure(text-value:txtSeverity)),
        structure(background-color: rowColor, cell-type: the symbol text-box, cell-value: structure(text-value:txtTagName)),
        structure(background-color: rowColor, cell-type: the symbol text-box, cell-value: structure(text-value:txtCSVData))
        )
    );
    
return tempRow;

end

DlgControls-Add-Gridview-Column(colAlignment: symbol, bgColor: symbol, bold: truth-value, cellType: symbol, cellValue: structure, ellipsisButton: truth-value, readOnly: truth-value, textColor: symbol, textValue: text, width: integer) = (structure)
