tempCol = structure ( alignment: colAlignment, background-color: bgColor, bold: bold, default-cell-type: cellType, default-cell-value: cellValue, ellipsis-button: ellipsisButton, read-only: readOnly, text-color: textColor, text-value: textValue, width: width);
return tempCol;
end

assemble-g2-event-grid-columns() = (sequence)

txtDateTime, txtSource, txtClass, txtSeverity, txtTagName, txtCSVData: structure;
tempCols: sequence;

begin

txtDateTime = call dlgControls-add-gridview-column(the symbol left, the symbol white, false, the symbol textbox,
structure(text-value: "dd-MMM-YYYY HH:MM:SS"), false, true, the symbol black, "Date and Time", 79);
txtSource = call dlgControls-add-gridview-column(the symbol left, the symbol white, false, the symbol textbox,
structure(text-value: "X"), false, true, the symbol black, "Source", 65);
txtClass = call dlgControls-add-gridview-column(the symbol left, the symbol white, false, the symbol textbox,
structure(text-value: "X"), false, true, the symbol black, "Class", 35);
txtSeverity = call dlgControls-add-gridview-column(the symbol left, the symbol white, false, the symbol textbox,
structure(text-value: "X"), false, true, the symbol black, "Severity", 33);
txtTagName = call dlgControls-add-gridview-column(the symbol left, the symbol white, false, the symbol textbox,
structure(text-value: "X"), false, true, the symbol black, "TagName", 80);
txtCSVData = call dlgControls-add-gridview-column(the symbol left, the symbol white, false, the symbol textbox,
structure(text-value: "X"), false, true, the symbol black, "CSVData", 186);

tempCols = sequence(txtDateTime, txtSource, txtClass, txtSeverity, txtTagName, txtCSVData);

return tempCols;

end

GENSYMCID-1508-TEST(node : class benchmark-node )
status : truth-value;
status-text : text;
begin
status,status-text = call GENSYMCID-1508-TEST-INNER();
if status then
    call fail(node, status-text)
else
    call pass(node);
end

GENSYMCID-1508-TEST-INNER() = (truth-value, text)
win : class g2-window; 
begin
win = call rt-util-get-twng-window();
conclude that done-parameter = 0;
start displays-query-g2-significant-event(win);
wait for 3 seconds;
if done-parameter /= 1 then
    return true, "Procedure displays-query-g2-significant-event didn't return in 3 seconds"
else
    return false,"";
end

{ Not only we find twng window, we wait until it exists. On slow build machines, twng can fail to connect quickly enough.
  If there is no TWNG, we never return, so set timeout for this procedure to limit waiting } 
rt-util-get-twng-window () = (class g2-window)
win1 : class g2-window;
ER : class error; 
begin
repeat 
    for win1 = each g2-window do
        post "[the g2-window-management-type of win1]";
        if the g2-window-management-type of win1 exists and the g2-window-management-type of win1 is remote and the g2-window-width of win1 /= 22 then 
            return win1;
        end;
    wait for 1 second; 
    end
end
